import React from "react";

const Character = () => {
  return (
    <div className="main-character">
      <section className="character-page">
        <h2>Character name</h2>
      </section>
      <section className="character-feedback">
        <h3>Feedback</h3>
      </section>
    </div>
  );
};

export default Character;
